var DEBUG_MODE=false;var TRACE_ERROR="error";var TRACE_WARNING="warning";var TRACE_DEBUG="debug";function trace(da,ea,fa){if(DEBUG_MODE==true){if(!fa)fa="";if(typeof console!="undefined"){try{switch(ea){case TRACE_ERROR:console.error(fa+" - ",da);break;case TRACE_WARNING:console.warning(fa+" - ",da);break;default:console.log(fa+" - ",da);}}
catch(e){alert("trace error "+e.toString());}}}}
function delegate(ga,ha){return function(){return ha.call(ga);}}
function decode_utf8(s){try{s=decodeURIComponent(escape(s));}
catch(e){}
return s;}
function encode_utf8(ia){return unescape(encodeURIComponent(ia));}